 And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And Etsy kar hesaplama secenegini tiklar\r\n    And magaza para birimi olarak Turkish Lira secer\r\n    And  vergi numarasi yok\r\n    And  Offsite Ads  %12\r\n    And ucretsiz listeleme var olarak secer\r\n    Then gerekli tüm alanlara satis bilgileri girer\r\n    And  hesapla butonuna tiklar\r\n    And gelen sonuclarin dogrulamsını yapar\r\n\r\n  @tc18\r\n  Scenario:TC18\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok satan saticilar sekmesine tiklar\r\n    And acilan sayfada ETSY ÇOK SATAN SATİCİLAR yazisinin geldigini teyit eder\r\n\r\n\r\n  @tc19\r\n  Scenario:TC19\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok satan saticilar sekmesine tiklar\r\n    And acilan sayfada gerekli bilgileri  doldurur\r\n    And filtreleri uygula secenegine tiklar\r\n    And Satın al popup geldigini teyit eder dogrular.\r\n\r\n\r\n  @tc20\r\n  Scenario: TC20\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok satan saticilar sekmesine tiklar\r\n    And acilan sayfada gerekli bilgileri  doldurur\r\n    And filtreleri uygula secenegine tiklar\r\n    And Satın al popup'una tiklar\r\n    And sayfayı asagi kaydirip paket iceriklerini okur\r\n    And  yillik secenegine tiklar paket icerigini kontrol eder\r\n\r\n\r\n  @tc21\r\n  Scenario: TC21\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok sa dırıp tüm ürünleri görür\r\n    And ikinci sayfaya gecer tüm ürünleri kontrol eder\r\n    And ucuncu sayfaya gecer tüm urunleri kontrol eder\r\n   # And sayfayı kapatır.\r\n\r\n    @tc09\r\n    Scenario: TC09\r\n      Given kullanıcı members.rexven.com sayfasına gider\r\n      Then  gecerli mail adresi girer\r\n      And  gecerli password girer\r\n      And  uretici ve toptancılar sekmesine tıklar\r\n      Then Uretici veya Toptancı ol sekmesine tıklar\r\n      And acilan sayfada gerekli bilgileri doldurur\r\n      And kayıt ol sekmesine tıklar\r\n      And  Kullanıcı magaza bilgileri gecersiz. Lütfen kontrol ediniz yazısını görür\r\n     # And sayfayı kapatır.\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ertuğrul/IdeaProjects/Members_Panel/src/test/resources/features/Uretici%20ve%20Toptancılar.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@regresyon","id":"2fdf9b44-8ed1-40bf-b95f-09d0b076c8f0"},{"location":{"line":2,"column":3},"name":"@ureticivetoptancı","id":"df6021a7-0643-4168-b4a2-f32ad79d0aba"}],"language":"en","keyword":"Feature","name":"Üretici ve Toptancılar","description":"","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@tc06","id":"db4a63ae-51a0-4edd-b778-51179afcff80"}],"keyword":"Scenario","name":"TC06","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"kullanıcı members.rexven.com sayfasına gider","id":"d6627166-6a64-47d0-89bc-7f247452fc4b"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"geçerli mail bir adresi girer","id":"2eb364da-5381-475c-8cdb-c4acbca26e92"},{"location":{"line":10,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"gecerli password girer","id":"0eb676c9-dc57-4123-ac83-2e44e65a2dd1"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType
